webpackJsonp([0xd5b12b7e72da],{4055:function(e,n){e.exports={data:{markdownRemark:{html:'<h2>CSS3 Nth Child Selector</h2>\n<p>The <code>nth-child</code> selector is a css psuedo-class taking a pattern by which to match one or more elements relative to their position amongst siblings.</p>\n<h2>Syntax</h2>\n<div class="gatsby-highlight">\n      <pre class="language-css"><code>  <span class="token selector">a:nth-child(pattern)</span> <span class="token punctuation">{</span>\n    <span class="token comment" spellcheck="true">/* Css goes here */</span>\n  <span class="token punctuation">}</span>\n</code></pre>\n      </div>\n<h3>Pattern</h3>\n<p>The patterns accepted by <code>nth-child</code> can come in the form of keywords or an equation of the form An+B.</p>\n<h4>Keywords</h4>\n<h5>Odd</h5>\n<p>Odd returns all odd elements of a given type.</p>\n<div class="gatsby-highlight">\n      <pre class="language-css"><code>  <span class="token selector">a:nth-childe(odd)</span> <span class="token punctuation">{</span>\n    <span class="token comment" spellcheck="true">/* CSS goes here */</span>\n  <span class="token punctuation">}</span>\n</code></pre>\n      </div>\n<h5>Even</h5>\n<p>Even returns all even elements of a given type.</p>\n<div class="gatsby-highlight">\n      <pre class="language-css"><code>  <span class="token selector">a:nth-childe(even)</span> <span class="token punctuation">{</span>\n    <span class="token comment" spellcheck="true">/* CSS goes here */</span>\n  <span class="token punctuation">}</span>\n</code></pre>\n      </div>\n<h4>An+B</h4>\n<p>Returns all elements matching the equation An+B for every positive integer value of n (in addition to 0).</p>\n<p>For example, the following will match every 3rd anchor element:</p>\n<div class="gatsby-highlight">\n      <pre class="language-css"><code>  <span class="token selector">a:nth-childe(3n)</span> <span class="token punctuation">{</span>\n    <span class="token comment" spellcheck="true">/* CSS goes here */</span>\n  <span class="token punctuation">}</span>\n</code></pre>\n      </div>\n<h3>More Information:</h3>\n<p><a href=\'https://developer.mozilla.org/en-US/docs/Web/CSS/%3Anth-child\' target=\'_blank\' rel=\'nofollow\'>MDN Documentation</a>\n<a href=\'https://css-tricks.com/almanac/selectors/n/nth-child/\' target=\'_blank\' rel=\'nofollow\'>CSS Tricks - nth child selector</a>\n<a href=\'https://css-tricks.com/examples/nth-child-tester/\' target=\'_blank\' rel=\'nofollow\'>CSS Tricks - nth child tester</a>\n<a href=\'https://www.w3schools.com/cssref/sel_nth-child.asp\' target=\'_blank\' rel=\'nofollow\'>W3Scools - nth child selector</a></p>',fields:{slug:"/css/css3-nth-child-selector/"},frontmatter:{title:"CSS3 Nth Child Selector"}}},pathContext:{slug:"/css/css3-nth-child-selector/"}}}});
